import React, {Component} from 'react';

class Landing extends Component {
  render() {
    return (
      <div className="container">
         <div className="jumbotron mt-5">
            <div className="col-sm-8 mx-auto">Welcome To The Jungle
            </div>
         </div>
      </div>
    )
  }
}

export default Landing;
